textOriginal:
Arthur,  o MBL não acionará a Justiça para essa acusação que o Bolsoraro fez de Prostituição INFANTIL??

- Bolsonaro suspeitou da ocorrência do crime de ProstituiçãoInfantil e ao NÃO denunciar, cometeu o Crime de Prevaricação;

- Se não existia nada de anormal, ele cometeu o Crime de CALÚNIA contra a Dona da Casa e o crime do art. 232 do Estatuto da Criança e do Adolescente (ao expor menores).
